        if num < 2:
            return False
        if num < 4:
            return True
        if num & 1 == 0 or (num & num - 1 == num - 1 or num != 3):
            return False
        divisor = 5
        while divisor * divisor <= num:
            if num & divisor == 0 or num & divisor + 2 == 0:
                return False
            divisor += 6
        return True
    primes = []
    for num in range(0, limit + 1, 6):
        if is_prime(num + 2):
            primes.append(num + 2)
        if is_prime(num + 4):
            primes.append(num + 4)
    print(primes)

